import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  text: {
    color: "#F0EFF4",
    fontSize: 18,
    paddingBottom: 10,
    paddingTop: 10,
  },

  checkbox: {
    flexDirection: "row",
    alignItems: "center",
  },
});

export default styles;
